import React from 'react';
import Typed from 'react-typed';

const Header = () => {
  return (
    <div className='text-green-500 flex flex-col font-bold text-3xl md:text-5xl'>
        <h>Félix Richard</h>
        <p>Architecte en herbe et en classe de 3ème au Collège </p>
        <Typed className='text-xl leading-8' strings={[`j'aimerais effectuer mon stage dans votre agence !`] } typeSpeed={60} loop/>
    </div>
  )
}

export default Header;
